import React from 'react'

const UserRecipes = ({savedRecipes}) => {
    const savedRecipesList = savedRecipes.map(recipe => {
        return (
            <>
                <h2>Your recipes</h2>
                <h3>{ recipe.title }</h3>
                {/* <p></p> */}
            </>
        )
    })

    return (
        <>
         { savedRecipesList }
        </>
    )
}

export default UserRecipes
